import React from 'react'
import styled from 'styled-components';
function Nav() {
    return (
        <StyledNav>
            <div>오늘만 보기</div>
            <div>내일만 보기</div>
            <div>함께 보기</div>
        </StyledNav>
    )
}
const StyledNav = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;

  div{
      margin: 0 15px;
      color: gray;
      font-weight: bold;
  }
  div:hover{
      font-weight: bold;
  }
`;
export default Nav
